import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Navbar/>
      <Router>
        <Switch>
          <Route path="/preflop-charts">
            <h1>Preflop Charts</h1>
          </Route>
          <Route path="/equity-calculatory">
            <h1>Equity Calculator</h1>
          </Route>
          <Route path="/">
            <h1>Home</h1>
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
